import mysql from 'mysql2'
import config from '../config/mysql.config.js'

export default class Mysql {

    constructor() {
        this.pool = mysql.createPool(config); // Crea un pool de conexiones MySQL

        this.tryConnection(); // Intenta conectar automáticamente al crear una instancia de la clase
    }

    async tryConnection() {
        try {
            // Obtiene una conexión del pool
            const connection = await this.pool.getConnection();
            console.log('Conectado a la DB');

            // Importante: libera la conexión cuando ya no la necesites
            connection.release();
        } catch (error) {
            console.error('No se pudo conectar a la DB:', error.message);
        }
    }

    // Métodos adicionales para ejecutar consultas, transacciones, etc., pueden ser añadidos aquí
}

